package JavaPrograms;

public class L81_WhileusingExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int i=10;
		
		
		if(i==10)
		{
			while(i<=15)
			{
				System.out.println(i);
				i++;
			}
		}
		else if(i!=10)
		{					

			System.out.println("out of value");
		}
	}

}
